import { useState } from "react";

import FormInput from "../form-input/form-input.component";
import Button from "../button/button.component";
const defaultFormFields= {
    Name: '',
    email:'',
    phone:'',
    subject:'',
    message:''

};
const Contact = () => {
    const [ formFields , SetFormFields ] = useState(defaultFormFields);
    const { name, email, phone,subject, message } = formFields;


    return(
        <div className="sign-up-container">
        <h2>Contact</h2>
            <span>Fill the form the contact with us </span>
            <form >
                <FormInput
                    label="Dispaly Name"
                    type="text" 
                    required 
                    //onChange={handleChange}
                    name="name"
                    value={name}
                />
                
                <FormInput 
                    label="Email" 
                    type="email" 
                    required 
                    //onChange={handleChange} 
                    name="email" 
                    value={email}
                />
                
                <FormInput 
                    label="phone" 
                    type="text" 
                    required 
                    //onChange={handleChange} 
                    name="phone" 
                    value={phone}
                />
              
                <FormInput 
                    label="Subject" 
                    type="text" 
                    required 
                    //onChange={handleChange} 
                    name="subject" 
                    value={subject}
                />
                <FormInput 
                    label="Message" 
                    type="text" 
                    required 
                    //onChange={handleChange} 
                    name="message" 
                    value={message}
                />
                <Button type="submit">Sign Up</Button>
            </form>
        </div>
    )

}

export default Contact;
